# https://leetcode.com/problems/3sum/description/?envType=study-plan-v2&envId=top-interview-150

from typing import List

class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        nums.sort()
        d_tracking = {}
        for idx, num in enumerate(nums):
            if num not in d_tracking:
                d_tracking[num] = []
            d_tracking[num].append(idx)

        l_result = []
        l_track_top = []
        for idx_1 in range(len(nums)):
            if nums[idx_1] in l_track_top:
                continue

            l_track_top.append(nums[idx_1])
            for idx_2 in range(len(nums)):
                if idx_2 <= idx_1:
                    continue

                cur_sum = nums[idx_1] + nums[idx_2]
                if cur_sum >= 0 and nums[idx_2] > 0:
                    break

                needed_num = 0 - cur_sum
                if needed_num not in d_tracking:
                    continue
                
                is_existed = False
                for idx_3 in d_tracking[needed_num]:
                    if idx_3 <= idx_2:
                        continue
                    else:
                        is_existed = True
                
                if is_existed:
                    l_result.append((nums[idx_1], nums[idx_2], nums[idx_3]))
                
        return list(set(l_result))
                
        

